import React,{Component,useState} from 'react';
import './App.css';
import Mytable from './Components/Table/index'
import { Table, Input, InputNumber, Popconfirm, Form, Spin, Button, Modal, Row } from 'antd';


// import Mytable from './Components/c/c'
import {
  Route,
  Switch,
} from 'react-router-dom';







class App extends Component{
  render(){
    const { main, sidebar } = this.props
    return(
      <div className="App">
        <Switch>
          <Route exact path='/' component = {{Mytable}} /> 
          <Route exact path="/myinfo" component={MyInfo} />          
       </Switch> 
      </div>

    );
  }
}
//表单页面
const MyInfo = function(props) {
  const [name, setName] = useState('');
  const [desc, setDesc] = useState('hello');
  const [url, setUrl] = useState('hello');
  const [source, setSource] = useState('hello');

  const myclick = () => {
     props.history.push({
      pathname:'/',
       state: {
         name,
         desc,
         url,
         source
       }
     })    

  }
  return (
    <>
    <div>
      <Input placeholder="名称" style={{width:"30%"}}  onChange={(e) => {setName(e.target.value)}}/>
      <br/>
      <Input placeholder="描述" style={{width:"30%"}}  onChange={(e) => {setDesc(e.target.value)}}/>
      <br/>
      <Input placeholder="网址" style={{width:"30%"}}  onChange={(e) => {setUrl(e.target.value)}}/>
      <br/>
      <Input placeholder="类型" style={{width:"30%"}}  onChange={(e) => {setSource(e.target.value)}}/>
      <br/>
      <Button onClick={myclick}>提交</Button>

    </div>
    </>
  );
};


export default App;
